INSERT INTO `contents` (`id`, `category_id`, `title`, `slug`, `content`, `file`, `vlink`, `status`, `created_by`, `created_at`, `updated_at`) VALUES
(1, 1, 'Welcome Video', 'welcome-video', '<div class=\"space-y-4\">\n  <div class=\"aspect-video w-full overflow-hidden rounded-lg border\">\n    <iframe\n      class=\"h-full w-full\"\n      src=\"https://www.youtube.com/embed/dQw4w9WgXcQ?autoplay=1&mute=1&controls=1\"\n      title=\"Welcome Video\"\n      frameborder=\"0\"\n      allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\"\n      allowfullscreen\n    ></iframe>\n  </div>\n  <p>Selamat datang di Zenner Club. Video ini otomatis diputar dan dapat diganti sesuai kebutuhan.</p>\n</div>', NULL, 'https://www.youtube.com/watch?v=dQw4w9WgXcQ', 'published', 1, '2026-02-07 09:07:43', '2026-02-07 09:07:43'),
(2, 2, 'Join Medsos', 'join-medsos', '<div class=\"space-y-3\">\n  <p>Data komunitas diambil otomatis dari API media sosial.</p>\n  <div data-source=\"api\" class=\"rounded-md border p-4 text-sm text-muted-foreground\">\n    Data akan ditampilkan di sini setelah integrasi API aktif.\n  </div>\n</div>', NULL, NULL, 'published', 1, '2026-02-07 09:07:43', '2026-02-07 09:07:43'),
(3, 3, 'Marketing Kit', 'marketing-kit', '<ul>\n  <li>Logo & brand guideline</li>\n  <li>Template poster & banner</li>\n  <li>Presentasi produk (PDF)</li>\n  <li>Copy materi promosi siap pakai</li>\n</ul>', NULL, NULL, 'published', 1, '2026-02-07 09:07:43', '2026-02-07 09:07:43'),
(4, 4, 'Copywriting', 'copywriting', '<h3>Template Copy</h3>\n<ul>\n  <li>Hook: \"Sudah coba solusi ini?\"</li>\n  <li>Problem: jelaskan pain point customer.</li>\n  <li>Solution: perkenalkan produk + manfaat utama.</li>\n  <li>CTA: ajak untuk order/DM.</li>\n</ul>', NULL, NULL, 'published', 1, '2026-02-07 09:07:43', '2026-02-07 09:07:43'),
(5, 5, 'Foto dan Video', 'foto-dan-video', '<p>Koleksi foto & video promosi. Unggah file terbaru untuk kebutuhan kampanye.</p>', NULL, NULL, 'published', 1, '2026-02-07 09:07:43', '2026-02-07 09:07:43'),
(6, 6, 'Procure Produk & Insentif Program', 'procure-produk-insentif-program', '<ol>\n  <li>Pilih paket produk sesuai level.</li>\n  <li>Ikuti program insentif yang sedang berjalan.</li>\n  <li>Laporkan progress ke upline atau admin.</li>\n</ol>', NULL, NULL, 'published', 1, '2026-02-07 09:07:43', '2026-02-07 09:07:43'),
(7, 7, 'Testimoni Produk', 'testimoni-produk', '<blockquote>\n  \"Produk ini membantu saya meningkatkan percaya diri dan penjualan.\"  Member Zenner Club\n</blockquote>', NULL, NULL, 'published', 1, '2026-02-07 09:07:44', '2026-02-07 09:07:44'),
(8, 8, 'Zenner Academy', 'zenner-academy', '<p>Modul pembelajaran Zenner Academy tersedia untuk meningkatkan skill penjualan dan leadership.</p>', NULL, NULL, 'published', 1, '2026-02-07 09:07:44', '2026-02-07 09:07:44'),
(9, 9, 'Skema Insentif Program', 'skema-insentif-program', '<table>\n  <thead>\n    <tr>\n      <th>Level</th>\n      <th>Syarat</th>\n      <th>Insentif</th>\n    </tr>\n  </thead>\n  <tbody>\n    <tr>\n      <td>Starter</td>\n      <td>5 transaksi</td>\n      <td>Bonus 5%</td>\n    </tr>\n  </tbody>\n</table>', NULL, NULL, 'published', 1, '2026-02-07 09:07:44', '2026-02-07 09:07:44'),
(10, 10, 'Produk Knowledge', 'produk-knowledge', '<ul>\n  <li>Manfaat utama produk</li>\n  <li>Komposisi & keunggulan</li>\n  <li>FAQ penggunaan</li>\n</ul>', NULL, NULL, 'published', 1, '2026-02-07 09:07:44', '2026-02-07 09:07:44'),
(11, 11, 'Cara Jualan (Organik)', 'cara-jualan-organik', '<ol>\n  <li>Bangun kepercayaan lewat edukasi.</li>\n  <li>Gunakan testimoni real.</li>\n  <li>Follow up konsisten.</li>\n</ol>', NULL, NULL, 'published', 1, '2026-02-07 09:07:44', '2026-02-07 09:07:44'),
(12, 12, 'Cara Iklan (Ads)', 'cara-iklan-ads', '<ol>\n  <li>Tentukan target audience.</li>\n  <li>Siapkan materi kreatif.</li>\n  <li>Analisa hasil dan optimasi.</li>\n</ol>', NULL, NULL, 'published', 1, '2026-02-07 09:07:44', '2026-02-07 09:07:44'),
(13, 13, 'Webinar & Online Training Jadwal', 'webinar-online-training-jadwal', '<table>\n  <thead>\n    <tr>\n      <th>Tanggal</th>\n      <th>Judul</th>\n      <th>Link</th>\n    </tr>\n  </thead>\n  <tbody>\n    <tr>\n      <td>2026-02-15</td>\n      <td>Kickoff Zenner Club</td>\n      <td>Zoom (link akan diperbarui)</td>\n    </tr>\n  </tbody>\n</table>', NULL, NULL, 'published', 1, '2026-02-07 09:07:45', '2026-02-07 09:07:45'),
(14, 14, 'Leaderboard', 'leaderboard', '<p>Leaderboard menampilkan peringkat member berdasarkan performa bulan ini.</p>', NULL, NULL, 'published', 1, '2026-02-07 09:07:45', '2026-02-07 09:07:45'),
(15, 15, 'Sertifikat Program', 'sertifikat-program', '<p>Unduh sertifikat setelah menyelesaikan program pelatihan.</p>', NULL, NULL, 'published', 1, '2026-02-07 09:07:45', '2026-02-07 09:07:45'),
(16, 16, 'Monthly Challenge', 'monthly-challenge', '<h3>Syarat</h3>\n<ul>\n  <li>Minimal 10 transaksi.</li>\n  <li>Posting 5 konten promosi.</li>\n</ul>\n<h3>Hadiah</h3>\n<ul>\n  <li>Voucher belanja</li>\n  <li>Bonus cash reward</li>\n</ul>', NULL, NULL, 'published', 1, '2026-02-07 09:07:45', '2026-02-07 09:07:45'),
(17, 17, 'Top Affiliate', 'top-affiliate', '<p>Daftar klansmen sementara untuk bulan berjalan.</p>', NULL, NULL, 'published', 1, '2026-02-07 09:07:45', '2026-02-07 09:07:45'),
(18, 18, 'Hall of Fame', 'hall-of-fame', '<p>Daftar pemenang pride sebelumnya akan ditampilkan di sini.</p>', NULL, NULL, 'published', 1, '2026-02-07 09:07:46', '2026-02-07 09:07:46'),
(19, 19, 'Rules & FAQ', 'rules-faq', '<ul>\n  <li>Ikuti aturan komunitas dan etika bisnis.</li>\n  <li>FAQ utama terkait program Zenner Club.</li>\n</ul>', NULL, NULL, 'published', 1, '2026-02-07 09:07:46', '2026-02-07 09:07:46'),
(20, 20, 'Kode Etik', 'kode-etik', '<ol>\n  <li>Jujur dan transparan.</li>\n  <li>Tidak menjanjikan hal di luar ketentuan.</li>\n  <li>Menjaga nama baik perusahaan.</li>\n</ol>', NULL, NULL, 'published', 1, '2026-02-07 09:07:46', '2026-02-07 09:07:46'),
(21, 21, 'FAQ', 'faq', '<dl>\n  <dt>Bagaimana cara bergabung?</dt>\n  <dd>Hubungi admin atau upline untuk registrasi.</dd>\n  <dt>Bagaimana cara klaim insentif?</dt>\n  <dd>Pastikan target terpenuhi dan konfirmasi ke admin.</dd>\n</dl>', NULL, NULL, 'published', 1, '2026-02-07 09:07:46', '2026-02-07 09:07:46');
