INSERT INTO `products` (`id`, `sku`, `slug`, `name`, `short_desc`, `long_desc`, `brand`, `warranty_months`, `base_price`, `currency`, `stock`, `weight_gram`, `length_mm`, `width_mm`, `height_mm`, `bv`, `b_sponsor`, `b_matching`, `b_pairing`, `b_cashback`, `b_retail`, `b_stockist`, `is_active`, `created_at`, `updated_at`) VALUES
(3, 'SKU-001BIOLOVE', 'biolove', 'BIOLOVE - (Pre_Order)', 'Resep Harmoni Rumah Tangga\r\nSejak zaman dahulu, leluhur kita mencari kekuatan di alam. Purwaceng (akar legendaris dari Dieng) dan Tongkat Ali telah menjadi rahasia para raja dan ksatria. Kami melanjutkan tradisi ini dengan memadukan herbal tersebut dengan energi modern.', 'Komposisi Unggulan\r\nPurwaceng, Tongkat Ali, & Cordyceps\r\nMeningkatkan stamina, gairah, dan daya tahan tubuh secara alami.\r\nL-Arginine & Guarana\r\nMemberikan dorongan energi maskulin dan menjaga vitalitas yang seimbang dan tahan lama.\r\nGinseng & Kopi Arabika\r\nMembantu meningkatkan fokus dan mood positif.\r\n\r\nLarutkan 1 Sct kedalam secangkir air panas (100ml)\r\nMinum di pagi atau sore hari setelah makan\r\n\r\n1 Kotak @8 Sachet @20gr', 'PURANUSA', 0, 350000.00, 'IDR', 63, 200, 60, 40, 150, 350000.00, 50000.00, 80000.00, 350000.00, 50000.00, 50000.00, 0.00, 1, '2025-12-16 07:20:49', '2026-02-07 02:34:28'),
(4, 'SKU-002SECRETGLOW', 'intimate-glow-screts-package', 'INTIMATE & GLOW SECRETS PACKAGE', 'INTIMATE & GLOW SECRETS PACKAGE, Paket produk perawatan organ intim wanita dan Paket sabun wajah perpaduan DNA Salmon, Retinol & Niacinamide', '<p>PURANUSA Brightening Soap (3 pcs @20gr) BPOM No. NA18251209701</p><p>PURANUSA Feminim Spray (4 @10ml) / BPOM No. NA18251600421 &amp; NA18251600422</p><p>PURANUSA Feminim Wash (1 @60ml) / BPOM No. NA18251600420<br><br><strong>PURANUSA Brightening Soap</strong></p><p><em>Sentuhan Salmon dan Retinol: Rahasia Kulit Cerah Alami Nusantara</em></p><p>Kami memadukan warisan kecantikan dengan inovasi mutakhir. Formula sabun premium ini membersihkan sekaligus meremajakan.</p><p><strong>Komposisi Unggulan dan Manfaat Utamanya</strong>,</p><ol><li><p>DNA Salmon &amp; Retinol, DNA Salmon kaya antioksidan dan nutrisi, bekerja sama dengan Retinol untuk meremajakan sel dan menjaga elastisitas kulit.</p></li><li><p>Glutathione &amp; Niacinamide, Kombinasi pencerah kulit yang efektif untuk memudarkan flek, meratakan warna kulit, dan memberikan efek glowing sejati.</p></li><li><p>Spirulina Platensis Extract, Sumber nutrisi kulit alami yang membantu menjaga kulit dari kerusakan radikal bebas.</p></li></ol><p>&nbsp;</p><p><strong>PURANUSA Feminime Wash &amp; Spray</strong></p><p><em>Perisai Alami dari Sirih dan Manjakani: Kepercayaan Diri yang Murni</em></p><p>Dirancang untuk wanita aktif yang mengutamakan kebersihan dan kesehatan holistik. Produk ini memberikan perlindungan pH seimbang dan kesegaran alami.</p><p><strong>Komposisi Unggulan dan Manfaat Utama,</strong></p><ol><li><p>Ekstrak Daun Sirih &amp; Manjakani, Pusaka turun-temurun. Bertindak sebagai agen pembersih dan antibakteri alami untuk menjaga keseimbangan area kewanitaan.</p></li><li><p>Centella Asiatica Extract, Memberikan efek menenangkan, merawat kulit sensitif, dan menjaga kelembaban area intimate.</p></li><li><p>Niacinamide &amp; Gliserin, Terutama dalam wash, membantu menjaga kelembutan dan tampilan kulit, serta mencegah kulit kering.</p></li></ol><ul><li><p>-</p></li></ul><p><strong>Pembagian Komisi Referal sebagai berikut :</strong><br>Referral Incentive&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Rp. 50.000</p><p>Partner Team Commission&nbsp;&nbsp;&nbsp; : Rp. 20.000</p><p>Team Affiliate Commission&nbsp;&nbsp;&nbsp; : Rp. 80.000 (sesuai mekanisme selisih peringkat)</p><p>Retail Commission&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Rp. 50.000</p><p>Cashback Commission&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; : Rp. 50.000</p><p></p>', 'PURANUSA', 0, 350000.00, 'IDR', 902, 200, 130, 40, 180, 350000.00, 50000.00, 80000.00, 350000.00, 50000.00, 50000.00, 0.00, 1, '2025-12-16 07:36:26', '2026-02-09 05:20:53'),
(5, 'SKU-003ZENLITE', 'biozenlite', 'BIOZENLITE - (Pre_Order)', 'Mengatur Metabolisme dan Energi Tubuh  <br>\r\nPencernaan yang sehat adalah fondasi kebugaran dan glowing skin modern. BIOZENLITE adalah revolusi serat yang ringan, lezat, dan esensial.', 'Komposisi Unggulan\r\n\r\nPsyllium Husk, Inulin, & Fibersol\r\nBertindak sebagai \'pembersih\' alami usus, membantu mengeluarkan racun (detoks), dan mendukung keteraturan metabolisme.\r\n\r\nAloevera & Stevia\r\nMembantu menjaga kelembaban usus, memberikan nutrisi serat tanpa tambahan gula berlebih.\r\n\r\nPremix Vitamin & Mineral\r\nMencukupi kebutuhan nutrisi harian untuk tubuh yang lebih bertenaga dan ringan.\r\n\r\nLarutkan 1 Sct kedalam 1 gelas air 100ml\r\nMinum Pagi atau Malam sebelum makan\r\n1 Kotak @8 Sct @15gr', 'PURANUSA', 0, 350000.00, 'IDR', 75, 200, 60, 40, 200, 350000.00, 50000.00, 80000.00, 350000.00, 50000.00, 50000.00, 0.00, 1, '2025-12-16 07:42:56', '2026-02-09 04:47:11'),
(6, 'SKU-003BIOZENERVE', 'biozenerve', 'BIOZENERVE - (Pre_Order)', 'Solusi Nyeri dan Peradangan Holistik - BIOZENERVE kembali ke kearifan alam untuk memulihkan tubuh dari akarnya.', '<p><strong>Keunggulan utama dari komposisi BIOZENERVE:</strong></p><p><strong>1. Sinergi Anti-Inflamasi yang Kuat</strong></p><p>Produk ini menggabungkan tiga bahan utama yang dikenal dalam dunia medis herbal sebagai agen anti-peradangan alami yang efektif:</p><ol><li><p><strong>Curcuma Longa (Kunyit):</strong> Mengandung kurkumin yang menghambat enzim penyebab peradangan.</p></li><li><p><strong>Zingiber Officinale (Jahe):</strong> Mengurangi produksi senyawa kimia yang memicu peradangan pada sendi dan otot.</p></li><li><p><strong>Sida Rhombifolia (Sidaguri):</strong> Secara spesifik sangat efektif dalam membantu menurunkan kadar asam urat dan meredakan radang sendi.</p></li></ol><p><strong>&nbsp;</strong></p><p><strong>2. Benteng Pertahanan Imunitas Berlapis</strong></p><p><em>Bukan hanya fokus pada penyembuhan, BIOZENERVE juga dirancang untuk pencegahan melalui penguatan imun:</em></p><ol><li><p><strong>Nigella Sativa (Jintan Hitam/Habbatussauda):</strong> Dikenal sebagai \"obat segala penyakit\" yang berfungsi meningkatkan aktivitas sel-sel pembunuh alami (NK cells) untuk melawan virus dan bakteri.</p></li><li><p><strong>Propolis Powder:</strong> Bertindak sebagai antibiotik alami yang sangat kuat untuk mempercepat proses pemulihan tubuh dari infeksi.</p></li></ol><p><strong>&nbsp;</strong></p><p><strong>3. Detoksifikasi dan Perlindungan Sel</strong></p><p><strong>Andrographis Paniculata (Sambiloto):</strong> Membantu membersihkan darah dan memiliki efek antipiretik (penurun panas) serta pelindung hati (hepatoprotektor).</p><p></p><p><em>Ini memastikan bahwa saat tubuh sedang melawan peradangan, organ vital tetap terlindungi.</em><br><br>Minum 2 sd 4 Kapsul / hari setelah makan<br>1 Kotak @1Botol @30 Kapsul</p><p></p>', 'PURANUSA', 0, 350000.00, 'IDR', 37, 200, 50, 50, 100, 350000.00, 50000.00, 80000.00, 350000.00, 50000.00, 50000.00, 0.00, 1, '2025-12-16 07:47:22', '2026-02-08 00:29:59'),
(7, 'SKU-004BIOALKALI', 'bioalkaline-bottle', 'BIOALKALINE BOTTLE', 'BIOALKALINE BOTTLE Dengan mengonsumsi air alkali terionisasi ini, dapat terjadi perubahan pada tubuh: Sebelum (Before): Tubuh cenderung memiliki masalah Acidity (Keasaman).Setelah (After): Air ini membantu mencapai PH Balance (Keseimbangan pH) dalam tubuh.', '<blockquote><h2><strong>Manfaat dan Hasil Air yang Dihasilkan Setelah melalui proses filtrasi, air yang dihasilkan disebut Alkaline Ionized Water dan memiliki manfaat sebagai berikut:</strong></h2><ul><li><p>Alkaline Balance (Keseimbangan Alkali): Meningkatkan pH air.</p></li><li><p>Negative Ions (Ion Negatif): Menambahkan ion negatif ke dalam air.</p></li><li><p>Small Molecules (Molekul Kecil): Membuat molekul air menjadi lebih kecil, yang dipercaya dapat meningkatkan penyerapan.</p></li><li><p>Low ORP (Potensi Reduksi Oksidasi Rendah): Memberikan sifat anti-oksidan pada air.</p></li><li><p>Far Infrared Ray (Sinar Inframerah Jauh): Menghasilkan sinar inframerah jauh.</p></li><li><p>Active Hydrogen (Hidrogen Aktif): Mengandung hidrogen aktif.</p></li></ul></blockquote><p></p><p></p>', 'PURANUSA', 0, 1500000.00, 'IDR', 92, 300, 60, 60, 300, 1500000.00, 210000.00, 200000.00, 1500000.00, 200000.00, 210000.00, 0.00, 1, '2025-12-16 07:55:45', '2026-02-02 22:31:36'),
(8, 'SKU-005ZENIONGREEN', 'biozenion-pendant-green', 'BIOZENION PENDANT Green', 'Menjaga Harmoni Tubuh dengan Manfaat Ion Negatif\r\nKebugaran bukan hanya nutrisi, tetapi juga energi. Kalung ini adalah produk wellness modern yang membawa manfaat Ion Negatif ke mana pun Anda pergi.', 'Manfaat Utama\r\nKandungan >6.000 Ion Negatif\r\nMembantu menetralkan efek radiasi elektromagnetik yang kita hadapi sehari-hari.\r\nDesain Universal & Modern\r\nDapat dipakai oleh semua kalangan usia (anak-anak hingga dewasa).\r\nFungsi Wellness\r\nMembantu melancarkan sirkulasi darah, meningkatkan fokus, dan menciptakan keseimbangan energi tubuh alami.', 'PURANUSA', 0, 1500000.00, 'IDR', 19, 300, 60, 50, 30, 1500000.00, 210000.00, 200000.00, 1500000.00, 200000.00, 210000.00, 0.00, 1, '2025-12-16 01:27:43', '2026-01-23 04:04:46'),
(9, 'SKU-006ZENIONBLUE', 'biozenion-pendant-blue', 'BIOZENION PENDANT Blue', 'Menjaga Harmoni Tubuh dengan Manfaat Ion Negatif\r\nKebugaran bukan hanya nutrisi, tetapi juga energi. Kalung ini adalah produk wellness modern yang membawa manfaat Ion Negatif ke mana pun Anda pergi.', 'Manfaat Utama\r\nKandungan >6.000 Ion Negatif\r\nMembantu menetralkan efek radiasi elektromagnetik yang kita hadapi sehari-hari.\r\nDesain Universal & Modern\r\nDapat dipakai oleh semua kalangan usia (anak-anak hingga dewasa).\r\nFungsi Wellness\r\nMembantu melancarkan sirkulasi darah, meningkatkan fokus, dan menciptakan keseimbangan energi tubuh alami.', 'PURANUSA', 0, 1500000.00, 'IDR', 92, 300, 60, 50, 30, 1500000.00, 210000.00, 200000.00, 1500000.00, 200000.00, 210000.00, 0.00, 1, '2025-12-16 01:32:45', '2026-02-04 22:48:08'),
(10, 'SKU-006INTWASH', 'puranusa-intimate-wash', 'PURANUSA INTIMATE WASH ( 1 Btl 60ml)  (RETAIL PLAN !)', 'PURANUSA Secrets Feminine Wash 60ml\r\n(NA18251600420)', 'PURANUSA Secrets Feminine Wash 60ml\r\n(NA18251600420)\r\nProduk Feminine Wash diformulasikan secara khusus dengan perpaduan bahan alami\r\ndan aktif yang unggul untuk menjaga kebersihan, kesehatan, dan kenyamanan area kewanitaan', 'PURANUSA', 0, 100000.00, 'IDR', 0, 60, 80, 80, 100, 100000.00, 0.00, 0.00, 0.00, 14000.00, 14000.00, 0.00, 1, '2025-12-30 09:03:31', '2026-01-18 21:33:39'),
(11, 'SKU-007SOAPBEAUTY', 'puranusa-beauty-soap', 'PURANUSA BEAUTY SOAP (3 pcs)', '3 Pcs Puranusa Brightening Soap', '3 Pcs @20gr Puranusa Brightening Soap\r\n(NA18251209701 )', 'PURANUSA', 0, 100000.00, 'IDR', 0, 60, 80, 80, 100, 100000.00, 0.00, 0.00, 0.00, 14000.00, 14000.00, 0.00, 1, '2025-12-30 09:47:30', '2026-01-18 21:34:19'),
(12, 'SKU-008INTSPRAY', 'secrets-feminine-spray-vanilla-buble-gum', 'Secrets Feminine Spray Vanilla & Buble Gum (4 Btl @10 ml)', 'Secrets Feminine Spray Vanilla (2)  & Buble Gum (2)  @10ml (NA18251600422 & NA18251600421)', '<p>Secrets Feminine Spray Vanilla &amp; Buble Gum @10ml (NA18251600422 &amp; NA18251600421)</p><p>Produk Feminine Spray diformulasikan secara khusus dengan perpaduan bahan alami</p><p>dan aktif yang unggul untuk menjaga kebersihan, kesehatan, dan kenyamanan area kewanitaan</p>', 'PURANUSA', 0, 200000.00, 'IDR', 0, 40, 80, 50, 100, 200000.00, 0.00, 0.00, 0.00, 28000.00, 28000.00, 0.00, 1, '2026-01-01 02:20:09', '2026-01-18 21:34:00'),
(13, 'SKU-009PROMOZENION', 'biozenion-pendant-k-green', 'BIOZENION PENDANT K-GREEN', 'PROMO SPESIAL BIOZENION PENDANT K-GREEN', '<p>PROMO SPESIAL BIOZENION PENDANT K-GREEN</p>', 'PURANUSA', 0, 1200000.00, 'IDR', 0, 100, 50, 50, 10, 1200000.00, 168000.00, 160000.00, 1200000.00, 160000.00, 168000.00, 0.00, 0, '2026-01-02 05:32:10', '2026-01-16 00:19:19');
